INSERT INTO `informativos` VALUES (1,'Importante!!!!\r\nEstagiários Itinerantes, favor não esquecer de trazer a folha ponto no dia de amanhã (20/05/2011).','2011-05-19 11:05:00','2011-05-19 20:05:00','2011-05-19 11:07:00','2011-05-19 11:07:52'),(2,'1) Hoje é dia de fazer RELATÓRIO, não se esqueçam.\r\n2) O campo PERÍODO refere-se à data do relatório ex. de 16 à 20 de Maio.- NÃO AO PERÍODO QUE O ESTAGIÁRIO CUMPRE NA ESCOLA.\r\n3) Todos devem fazer relatórios retroativos à 1º de Abril.','2011-05-20 10:59:00','2011-05-21 10:59:00','2011-05-20 11:04:28','2011-05-20 11:04:28'),(3,'FAZER RELATÓRIO PARA PERIODO 23 A 27 DE MAIO','2011-05-27 17:32:00','2011-05-30 21:00:00','2011-05-27 17:33:12','2011-05-27 17:33:12'),(4,'FAZER RELATÓRIO DO PERÍODO 30/5 à 3/6','2011-06-03 10:59:00','2011-06-06 10:59:00','2011-06-03 11:01:39','2011-06-03 11:01:39'),(5,'Verificar seu ponto eletrônico se existe algum dia que necessita JUSTIFICAR. - Lembramos que Sábado e Domingos não necessitam de justificativa. Os demais dias se aparecer o link justificar, favor proceder a justificativa no próprio sistema.','2011-06-06 11:57:00','2011-06-08 11:57:00','2011-06-06 12:00:29','2011-06-06 12:00:29'),(6,'TODOS ESTAGIÁRIOS: FAZER RELATÓRIO DO PERÍODO 06 À 10 DE JULHO','2011-06-10 04:06:00','2011-06-12 23:06:00','2011-06-08 19:08:35','2011-06-08 19:08:35'),(7,'Verifique seu ponto eletrônico se há algum dia que necessite justificar (desconsidere Sábados e Domingos)','2011-06-15 11:52:00','2011-06-17 03:00:00','2011-06-15 11:54:30','2011-06-15 11:55:33'),(8,'FAZER RELATÓRIO DA ATIVIDADES DO PERIODO 13 A 17 DE JUNHO ==> TODOS DEVEM FAZER <==','2011-06-17 03:24:00','2011-06-21 02:55:00','2011-06-16 18:26:44','2011-06-16 18:26:44'),(10,'Não esqueça de fazer relatório referente a semana passada (dias 20/21/22). ATENÇÃO: Houve alteração na página de Relatório on-line. Preencha o relatório das atividades conforme o dia realizados, se não houver nada informar \"NADA A RELATAR\".','2011-06-27 18:49:00','2011-06-30 02:49:00','2011-06-27 18:50:28','2011-06-27 18:50:28'),(11,'FAZER RELATÓRIO O LINE DO PERIODO 27/6 a 1/7','2011-07-01 13:53:00','2011-07-04 13:53:00','2011-07-01 13:54:16','2011-07-01 13:54:16'),(12,'Higor quebrei seu galho, mas mais cuidado com isso.','2011-07-15 17:37:00','2011-07-15 17:40:00','2011-07-15 17:37:54','2011-07-15 17:37:54'),(13,'Atencao\r\nTeste','2011-07-18 11:30:00','2011-07-18 11:34:00','2011-07-18 11:31:04','2011-07-18 11:31:04'),(14,'Atenção\r\nTodos','2011-07-18 16:00:00','2011-07-18 16:05:00','2011-07-18 16:00:59','2011-07-18 16:00:59'),(15,'FAZER RELATÓRIO DA SEMANA - 01 a 05 de Agosto','2011-08-05 15:27:00','2011-08-09 02:30:00','2011-08-05 15:28:05','2011-08-05 15:28:05'),(16,'FAZER RELATÓRIO DE ATIVIDADES DA SEMANA 8 a 12 de AGOSTO','2011-08-12 15:31:00','2011-08-13 02:59:00','2011-08-12 15:32:56','2011-08-12 15:32:56'),(17,'ATENÇÃO - Como podem observar, houve alteração no layout sistema, mas a funcionalidade continua a mesma, cuidado que algumas opções do menu foram alteradas de local.','2011-08-15 15:51:00','2011-08-18 02:51:00','2011-08-15 15:56:41','2011-08-15 15:56:41'),(18,'1) FAZER RELATÓRIO DE ATIVIDADES DA SEMANA 15 A 19 DE AGOSTO.\r\n2) VERIFICAR E SE NECESSÁRIO JUSTIFICAR PONTO ELETRÔNICO DA SEMANA 15 A 19 DE AGOSTO','2011-08-19 12:03:00','2011-08-19 12:03:00','2011-08-19 12:05:53','2011-08-19 12:05:53'),(19,'1) FAZER RELATÓRIO DE ATIVIDADES DA SEMANA 15 A 19 DE AGOSTO.\r\n2) VERIFICAR E SE NECESSÁRIO JUSTIFICAR PONTO ELETRÔNICO DA SEMANA 15 A 19 DE AGOSTO','2011-08-19 12:03:00','2011-08-24 02:03:00','2011-08-19 12:06:16','2011-08-19 12:06:16'),(20,'O servidor do sistema INFOSEDUC ficou fora do ar nos dias 23, 24 e 25 de Agosto -Caso você não tenha conseguido bater ponto eletrônico favor justificar como \"SISTEMA FORA DO AR\"','2011-08-24 11:20:00','2011-08-27 11:20:00','2011-08-24 11:23:08','2011-08-25 16:05:39'),(21,'1) NÃO ESQUECER DE FAZER RELATÓRIO DAS ATIVIDADES REFERENTES AO PERIODO 29/8 À 2/9\r\n...........  2) VERIF