SEU PONTO ELETRÔNICO\r\n(2) FAZER RELATÓRIO DE 6 A 10 DE FEVEREIRO','2012-02-16 10:15:00','2012-02-17 10:15:00','2012-02-16 10:17:22','2012-02-16 10:17:22'),(32,'Fazer relatório semanal do periodo de 13 a 17 de Fevereiro. (verifique se você está en dia com seus relatórios e ponto eletrônico)','2012-02-17 10:26:00','2012-02-21 01:26:00','2012-02-17 10:28:15','2012-02-17 10:28:15'),(33,'Fazer relatório da semana 23 e 24 Fev.','2012-02-24 14:17:00','2012-02-27 15:17:00','2012-02-24 14:18:12','2012-02-24 14:18:12'),(34,'Fazer relatório da semana passada e verificar justificativas ponto eletrônico','2012-03-06 18:35:00','2012-03-08 18:35:00','2012-03-06 18:36:37','2012-03-06 18:36:37'),(35,'NÃO ESQUEÇA DE FAZER O RELATÓRIO DA SEMANA PASSADA, APROVEITE E VERIFIQUE SE HÁ NECESSIDADE DE JUSTIFICAR PONTO ELETRÔNICO.','2012-03-13 11:22:00','2012-03-15 11:22:00','2012-03-13 11:23:43','2012-03-13 11:23:43'),(36,'NÃO ESQUECER DE FAZER RELATÓRIO SEMANAL, CASO TENHA ALGUM EM ATRASO, FAVOR ATUALIZAR TODOS OS RELATÓRIOS.','2012-04-19 14:18:00','2012-04-26 02:18:00','2012-04-19 14:19:33','2012-04-19 14:19:33'),(37,'PARA OS ESTAGIÁRIOS QUE AINDA NÃO REALIZARAM, FAVOR FAZER RELATÓRIO SEMANAL DO PERIODO 7 A 11 DE MAIO.','2012-05-14 12:41:00','2012-05-15 22:41:00','2012-05-14 12:43:06','2012-05-14 12:43:06');
