INSERT INTO `relatestagiarios` VALUES (5,6,10,'VESPERTINO','2011-03-31 17:30:00','','IMPRESSORA NOVA COMPRADA.','INSTALAÇÃO E CONFIGURAÇÃO DA IMPRESSORA REALIZADA.','Como a escola está em greve, só estou aqui para eventuais problemas dos computadores da secretária, conforme pediu a Diretora Maria.','2011-03-31 17:32:41','2011-04-26 13:39:13',1,'Naor'),(6,19,9,'28/03/2011 ATÉ 01/04/2011','2011-04-04 16:24:00','VANGRI','MANUTENÇÃO FÍSICA E LÓGICA, TESTES, INSTALAÇÃO DE SOFTWARE, MONTAGEM E DESMONTAGEM DE COMPUTADOR. ','DURANTE ESSA SEMANA, PERMANECI NA SECRETARIA DE EDUCAÇÃO AMERICANA, POIS A UNIDADE EMEF PAULO FREIRE ESTÁ EM GREVE. FIZ MANUTENÇÃO FÍSICA E LÓGICA, TESTES, INSTALAÇÃO DE SOFTWARE, MONTAGEM E DESMONTAGEM DE COMPUTADOR DURANTE O PERÍODO QUE PERMANECI NA SEC','CuMpriu horário na SEDUC','2011-04-04 16:26:50','2011-04-26 13:26:25',1,'Naor'),(7,50,6,'7 ','2011-04-08 14:43:00','NAOR','06/04 - SERVIDOR DE DHCP SEM ANTI VIRUS.\r\n07/04 - VERIFICAÇÃO DE TODAS AS MAQUINAS ULTILIZADAS NA LOUSA DIGITAL APENAS 1 APRESENTOU ANOMALIAS.\r\n\r\n\r\n06/04 - SERVIDOR DE DHCP SEM ANTI VIRUS.\r\n07/04 - VERIFICAÇÃO DE TODAS AS MAQUINAS ULTILIZADAS NA LOUSA DIG','06/04 - INSTALEI UM ANTI VIRUS PARA SERVIDOR, LIMPESA DE PROGRAMAS QUE NÃO HAVIAM UTILIDADES.\r\n07/04 - APOS CONSTATADO ESTA ANOMALIA EM UMA DA MAQUINAS VERIFICADAS, FORMATEI, MAS, NÃO HOUVE EXITO NESTE PROCEDIMENTO, POIS A MAQUINA APRESENTOU ERRO NA PORTA','para controle de todos os materiais que entram e sai do lab. criei uma planilha de controle  de ordem de serviço interno para os estagiarios da unidade.','2011-04-08 15:02:29','2011-04-25 17:06:45',1,'Pedro Feltrin Nali'),(8,6,10,'VESPERTINO','2011-04-08 16:29:00','ALEXANDRE','','','Fiquei ausente esta semana por conta de conjutivite. Já entreguei o atestado para a diretora','2011-04-08 16:31:24','2011-04-26 13:38:25',1,'Naor'),(9,43,3,'TARDE','2011-04-08 17:46:00','ELIZABETH CARNE BORGES','-NECESSIDADE DE QUE FOSSE FEITA UMA PLANILHA E GRÁFICO A PARTIR DO QUEST